import React, { useState } from "react";
import Button from "./UI/Button/Button";
import { styled } from "styled-components";

const Icon = styled.i`
  width: 20px;
  height: 20px;
  display: flex;
  align-items: center;
  justify-content: center;
  padding-right: 8px;
`;

export default function NavBarItem(props) {
  return (
    <Button>
      <Icon class={`fa ${props.icon}`}></Icon>
      <p>{props.type}</p>
    </Button>
  );
}
